pragma solidity ^0.6.2;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/utils/Counters.sol";

contract NFTDemo is ERC721 {
    using Counters for Counters.Counter;
    Counters.Counter private _tokenIds;


    struct TokenData {
        uint256 price;
        address payable creator;
    }
    mapping(uint256 => TokenData) public tokens;

    address payable platform;
    uint128 bpArtists = 9400; // 94.00 in basis points (parts per 10,000)
    uint128 bpPlatform = 600; // 6% for the platform

    constructor() public ERC721("Luis NFT", "LUIS") {}

    function createItem(
        address payable _creator,
        string memory tokenURI,
        uint256 _price
    ) public returns (uint256) {
        _tokenIds.increment();

        uint256 newItemId = _tokenIds.current();
        _mint(_creator, newItemId);
        _setTokenURI(newItemId, tokenURI);

        approve(address(this), newItemId);
        // set the sale price etc

        tokens[newItemId] = TokenData({
            price : _price,
            creator : _creator
        });

        emit Approval(msg.sender, address(this), newItemId);

        return newItemId;
    }

    function buy(uint256 _tokenId) external payable {
        address buyer = msg.sender;
        uint256 payedPrice = msg.value;

        // require(getApproved(_tokenId) == address(this), "User not authorized");
        uint256 price = tokens[_tokenId].price;
        require(payedPrice >= price, "Price is not enough");

        address payable creator = tokens[_tokenId].creator;
        if (ownerOf(_tokenId) == creator)
        {
            creator.transfer(payedPrice * bpArtists / 10000);
        }

        _transfer(ownerOf(_tokenId), buyer, _tokenId);
        // _transfer(from, to, tokenId);
    }
}
